description:
Eve is a sexy assassin who kills without remorse - until one botched hit changes everything. Caught off guard, Eve is stabbed in the head and inadvertently murders a young girl. The blade is removed, but the damage is done: Eve's mind is now filled with visions of past victims. The hunter becomes the haunted and this killing machine is plagued with remorse. Unable to &quot;work,&quot; this mob asset has become a liability...
